//There are the code which will be added to all playables releases and all playables launched in Mraid.io Dashboard
//Here we can add code for all playables similar to changes in Mraid.io Creative Template
//This code uses as is and do not transforms via babel! Write maximum compatible code!

(function() {

	const URLTracking = {

		holdEvents: [],

		trackedEvents: {},

		init: function() {

			Broadcast.once('MRAID Viewable', function() {

				if (URLTracking.holdEvents.length > 0) {

					for (var i=0; URLTracking.holdEvents[i]; i++) URLTracking.sendAction(URLTracking.holdEvents[i][0], URLTracking.holdEvents[i][1], URLTracking.holdEvents[i][2]);

					URLTracking.holdEvents = [];

				}

			}, "release-integration-script");

			for (var i=0; Settings["track-events"][i]; i++) {

				(function(eventName) {

					if (MRAID && MRAID.TrackedEvents[eventName]) {

						URLTracking.trackAction(eventName, null, true);

					} else {

						Broadcast.on(eventName, function() {

							URLTracking.trackAction(eventName);

						}, "release-integration-script");

					}

				})(Settings["track-events"][i].name);

			}

		},

		trackAction: function(eventName, params, force = false) {

			if (Settings["track-url-actions"] && eventName in Settings["track-url-actions"]) {

				for (var i=0; Settings["track-url-actions"][eventName][i]; i++) {

					if (!URLTracking.trackedEvents[eventName] || Settings["track-url-actions"][eventName][i].trackMultiple || force) {

						if (MRAID.isViewable || Settings["track-events-on-viewable"] === false) {

							URLTracking.sendAction(eventName, Settings["track-url-actions"][eventName][i], params);

						} else {

							URLTracking.holdEvents.push([eventName, Settings["track-url-actions"][eventName][i], params]);

						}

					}

				}

				URLTracking.trackedEvents[eventName] = true;

			}

		},

		sendAction: function(eventName, urlObject, params) {

			if (urlObject && urlObject.url) {

				if (urlObject.trackingType === 'xhr') {

					MRAID.log('URL Tracker (xhr):', eventName, '###', urlObject.url);

					let xhr = new XMLHttpRequest();

					xhr.open('GET', urlObject.url
						.replace(new RegExp('\\[timestamp\\]', "ig"), Date.now())
						.replace(new RegExp('\\[event-name\\]', "ig"), encodeURIComponent(eventName))
						.replace(new RegExp('\\[os\\]', "ig"), MRAID.ios ? 'ios' : (MRAID.android ? 'android' : '')),
						true);

					xhr.send();

				} else if (urlObject.trackingType === 'img') {

					MRAID.log('URL Tracker (img):', eventName, '###', urlObject.url);

					var img = new Image();

					img.src = urlObject.url
						.replace(new RegExp('\\[timestamp\\]', "ig"), Date.now())
						.replace(new RegExp('\\[event-name\\]', "ig"), encodeURIComponent(eventName))
						.replace(new RegExp('\\[os\\]', "ig"), MRAID.ios ? 'ios' : (MRAID.android ? 'android' : ''));

				} else if (urlObject.trackingType === 'script') {

					MRAID.log('URL Tracker (script):', eventName, '###', urlObject.url);

					let scr = document.createElement('script');

					scr.type = 'text/javascript';

					scr.src = urlObject.url
						.replace(new RegExp('\\[timestamp\\]', "ig"), Date.now())
						.replace(new RegExp('\\[event-name\\]', "ig"), encodeURIComponent(eventName))
						.replace(new RegExp('\\[os\\]', "ig"), MRAID.ios ? 'ios' : (MRAID.android ? 'android' : ''));

					document.body.appendChild(scr);

				}

			}

		}

	};

	URLTracking.init();

})();

(function() {

	var CtaOnClicks = {

		init: function() {

			Broadcast.on("Interaction", function() {

				if (Settings["cta-on-clicks"] && MRAID.Interactions >= Settings["cta-on-clicks"]) {

					if (App && App.Gameplay) {

						App.Gameplay.transferToCTA('cta clicks', 200);

						MRAID.CtaClicksComplete = true;

						Broadcast.call("Cta clicks complete");

					}

				}

			}, "release-integration-script");

		},

	};

	CtaOnClicks.init();

})();
</script>
